syntax = "proto3";

package bokura;

import "table_basic.proto";

message TeamTargetTableBase {
    int32 Id = 1463;
    mlstring Name = 439;
    bool HasFatherType = 1360;
    int32 BelongType = 1416;
    string TimeCycle = 647;
    string Time = 601;
    int32 FunctionID = 850;
    int32 RelativeDungeonId = 1344;
    int32 MemberCountStopMatch = 326;
    int32 Sort = 1643;
    string Icon = 1153;
}
message TeamTargetTableMgr {
    repeated bokura.TeamTargetTableMgr.DatasEntry datas = 1;
}
